import React from 'react';
import Main_nav_item_left from "./main_nav_item_left.jsx";
import Main_nav_item_rigth from "./inner_nav_item_rigth";
import "./header.css";
import "./inner_nav_item_rigth.css";
import "./main_nav_item_left.css"

import {
    Link
} from "react-router-dom";

class Header extends React.Component{
    render() {
        return(
            <header className={"container-fluid text-align-center"} id={"top-bar"}>
                <nav className="navbar navbar-light amber lighten-4 mb-4 ">
                    <Link to="/"><img className={"navbar-brand logo_img"} src={"./images/logo_basics_summery.png"} alt={"/"}/></Link>
                    <Main_nav_item_left/> <Main_nav_item_rigth/>
                    <button className={"navbar-toggler first-button"} type="button" data-toggle="collapse" data-target="#navbarSupportedContent20"
                            aria-controls="navbarSupportedContent20" aria-expanded="false" aria-label="Toggle navigation">
                        <div className="animated-icon1"><span></span><span></span><span></span></div>
                    </button>

                    <div className={"collapse navbar-collapse first_row_left"} id="navbarSupportedContent20">

                        <ul className="navbar-nav mr-auto">


                        </ul>

                    </div>
                </nav>

            </header>
        )
    }
}

export default Header;
